import React, { useState } from 'react';
import PropTypes from 'prop-types';
import styles from './EditorImageRender.module.css';
import { createEditor } from 'slate';
import { Slate, Editable, withReact } from 'slate-react'

const editorImage = "data:image/jpeg;charset=utf-8;base64,";

const initialValue = [{
  type: 'paragraph',
  children: [{ text: editorImage }],
},]

const EditorImageRender = () => {
  const [editor] = useState(() => withReact(createEditor()));
  return (
    <div className={styles.EditorImageRender}>
      <Slate editor={editor} value={initialValue} >
        <Editable />
      </Slate>
    </div>
  )
};

EditorImageRender.propTypes = {};

EditorImageRender.defaultProps = {};

export default EditorImageRender;

